import "../Style/HomePage.css";
import Menubar from "./Menubar";
import summerImage from "../images/summer.jpg";
import summerImage1 from "../images/summer1.jpg";
import summerImage2 from "../images/summer2.jpg";
import maplekingImage from "../images/mapleking.jpg";

function HomePage() {
  return (
    <div className="App">
      <Menubar></Menubar>
      <div className="App-content-Home">
        <div className="description">
          <p>페이지에 대한 설명</p>
        </div>
        <div className="image-section">
          <div className="image-quarter">
            <img src={summerImage1} alt="프로젝트 관련 사진 1" />
          </div>
          <div className="image-quarter">
            <img src={summerImage2} alt="프로젝트 관련 사진 1" />
          </div>
          <div className="image-quarter">
            <img src={summerImage} alt="프로젝트 관련 사진 1" />
          </div>
          <div className="image-quarter">
            <img src={maplekingImage} alt="프로젝트 관련 사진 1" />
          </div>
        </div>
      </div>
    </div>
  );
}

export default HomePage;
